CREATE TABLE EMPLOYE (
  nom varchar2(255) default NULL,
  prenom varchar2(255) default NULL,
  salaire varchar2(50) default NULL,
  service varchar2(255) default NULL,
  poste varchar2(255) default NULL,
  adresse varchar2(255) default NULL,
  ville varchar2(255),
  embauche varchar2(50) default NULL,
  PRIMARY KEY(nom,prenom)
);

